class Hello{

 def log;
 def context;
 def testRunner;

 def Hello(log, context, testRunner){
  this.log = log
  this.context = context
  this.testRunner = testRunner
 }

 def sayHello(String name){
  log.info ("   Hello "+name);
 }

}

context.setProperty("Hello", new Hello(log,context,testRunner))

//aanroepen van de hello klasse
def testStep = testRunner.testCase.getTestStepByName("Hello")
//meegeven van de context
testStep.run(testRunner, context)
//toegang tot de context en we kunnen die nu aanroepen
context.Hello.sayHello('dit is een test')

//aanroepen van de hello klasse in een andere testCase
project = testRunner.testCase.testSuite.project ;
tcase = project.testSuites["TestSuite 2"].testCases["TestCase 1"] ; 
Hello = tcase.getTestStepByName("Hello");
//meegeven van de context
Hello.run(testRunner, context)
//toegang tot de context en we kunnen die nu aanroepen
context.Hello.sayHello('dit is een test')

//aanroepen van een TestCase 
def tCase = testRunner.testCase.testSuite.testCases["TestCase 2"]
